import React from 'react';
import { useLocation } from 'react-router-dom';
import './ProfilePage.css'; // Create this CSS file for styling

const ProfilePage = () => {
  const location = useLocation();
  const profiles = location.state?.profiles || [];

  if (profiles.length === 0) {
    return (
      <div className="profile-page">
        <h1>Researcher Profiles</h1>
        <p>No profiles found.</p>
      </div>
    );
  }

  return (
    <div className="profile-page">
      <h1>Researcher Profiles with Extracted Interests</h1>
      <div className="profiles-list">
        {profiles.map((profile, index) => (
          <div key={index} className="profile-card">
            <h2>{profile.name}</h2>
            <h3>Research Topics:</h3>
            <ul>
              {profile.research_topics.map((topic, topicIndex) => (
                <li key={topicIndex}>{topic}</li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ProfilePage;
